import "../css/footer.css";

const Section_card = () => {
  return (
    <div>
      <div class="container section-title-container">
        <h1 class="section-title section-title-bold-center">
          <b></b>
          <span class="section-title-main">
            office automation &amp; integrated solution
          </span>
          <b></b>
        </h1>
      </div>
    </div>
  );
};

export default Section_card;
